import React from 'react';


const Navbar = ({item, deleteItm}) => {

    const listItem = item.map(item => {

        return item.age > 20 ? (

            <table key={item.id}>
                <tbody>
                <tr>
                    <td>Name: {item.name}</td>
                    <td>Age: {item.age}</td>
                    <td>Sex: {item.sex}</td>
                    <button onClick={() => {deleteItm(item.id)} }>Delete</button>
                </tr>
                </tbody>

            </table>
        ) : null;
    });


    return (

        <div className={'navbar'}>

            {listItem}

        </div>

    );

};


export default Navbar;
